import React from "react";
export default function MvEngineMotor() {
  return (
    <>
      <div className="engineMotor-layout">
        <div className="engineMotor-img">
          <img alt="" src="./img/rush1000/engine.webp" width="100%"></img>
        </div>
        <div className="engineMotor-container">
          <strong className="engineMotor-header"></strong>
        </div>
      </div>
    </>
  );
}
